	<style type="text/css">
html,body{
            width: 100vw;
            height: 100%
        }
body{
	background-color: black;
    overflow: hidden;
}
*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;

  -webkit-touch-callout: none; /* iOS Safari */
    -webkit-user-select: none; /* Safari */
     -khtml-user-select: none; /* Konqueror HTML */
       -moz-user-select: none; /* Old versions of Firefox */
        -ms-user-select: none; /* Internet Explorer/Edge */
            user-select: none; /* Non-prefixed version, currently
                                  supported by Chrome, Edge, Opera and Firefox */
}
@-webkit-keyframes spinner {
    0% {
    -webkit-transform: scale(1) translateY(0vh);
    }
    50% {
    -webkit-transform: scale(1.2) translateY(2vh);
    }
    100% {
    -webkit-transform: scale(1) translateY(0vh);
    }
}
.spinner {
    -webkit-animation-name: spinner;
    -webkit-animation-timing-function: linear;
    -webkit-animation-iteration-count: infinite;
    -webkit-animation-duration: 6s;
    -webkit-transform-style: preserve-3d;
    pointer-events: none;

    width: 100%;
}
.seq img{
    opacity: 1;
    position: absolute;
    left: 50%;
    top: 50%;
    pointer-events: none;
    width: 100%;

    -webkit-backface-visibility: hidden; 
    -ms-transform: translate(-50%, -50%) translateZ(0); /* IE 9 */
    -webkit-transform: translate(-50%, -50%) translateZ(0); /* Chrome, Safari, Opera */
    transform: translate(-50%, -50%) translateZ(0);
}
.item{
    position: absolute;
    /*height: 27.5vh;*/
    width: 17.5vh;
    overflow: visible;
    z-index: 10000;
    transform: translate(-50%, 0%);
}

.drop{
    transition: 0.5s ease-out;
}
.id_box{
  z-index: 100000;
    position: absolute;
    bottom: 0;
    height: 10vh;
    width: 100%;
    background: #ff3766;
    left: 0;
}
.bot_item{
    height: 100%;
    width: auto;
    border: 5px solid white;
    display: inline-block;
    margin-right: 5px;
    position: relative;
}
.bot_item img{
    height: 100%;
}
.button_r{
    height: 100%;
    position: absolute;
    right: 0;
    width: 50%;
}
.button_l{
    height: 100%;
    position: absolute;
    left: 0;
    width: 50%;
}
.button_r:hover,
.button_l:hover{
    background: rgba(0,0,0,.5);
    background-image: url(arrow.png);
    background-repeat: no-repeat;
    background-size: contain;
    background-position: center;
}
.button_l{
    transform: scale(-1);
}
.button{
    position: absolute;
    width: 10vh;
    height: 5vh;
    background-color: white;
    text-align: center;
    line-height: 5.2vh;
    font-family: sans-serif;
    right: 1vh;
    top: 25%;
    border-radius: 3px;
    cursor: pointer;
    text-transform: uppercase;
}
.button:hover{
    filter: invert(1);
}
.close{
    position: absolute;
    background-color: white;
    z-index: 1000;
    background-image: url(close.png);
    background-repeat: no-repeat;
    background-size: contain;
    background-position: center;
    width: 3vh;
    height: 3vh;
    border-radius: 50%;
    transform: translate(50%, -50%);
    right: 0;
}
video{
    position: absolute;
    left: 50%;
    top: 0%;
    transform: translate(-50%,0%);
    width: 100vw;
}
.item_inner{
    width: 100%;
    height: 100%
}
.loading span{
    font-family: sans-serif;
    text-transform: uppercase;
    font-size: 3.5vh;
    left: 50%;
    top: 50%;
    position: absolute;
    transform: translate(-50%, -50%);
}
.loading{
    position: absolute;
    width: 100vw;
    height: 100vh;
    z-index: 1000000;
    background: black;
    color: white;
}
